import logo from './logo.svg';
import './App.css';
// src/App.js
import Header from './components/Header';
import Hero from './components/Hero';
import CarHighlights from './components/CarHighlights';
import Footer from './components/Footer';

function App() {
  return (
    <div>
      <Header />
      <Hero />
      <CarHighlights />
      <Footer />
    </div>
  );
}

export default App;
